script:
const size = 32;
const origin = { x: -16, z: -16 };
const cube = size * 0.2;
const hue = Math.random();
const corners = [
  [0, 0, 0],
  [size - 1, 0, 0],
  [0, 0, size - 1],
  [size - 1, 0, size - 1],
  [0, size - 1, 0],
  [size - 1, size - 1, 0],
  [0, size - 1, size - 1],,
  [size - 1, size - 1, size - 1],
];
reset();

const distance = (a, b) => {
  const dx = a[0] - b[0], dy = a[1] - b[1], dz = a[2] - b[2];
  return Math.sqrt(dx * dx + dy * dy + dz * dz);
};

box(origin.x - 1, 0, origin.z - 1, size + 2, size + 2, size + 2, 2);
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < size; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const p = [x, y, z];
      const d = corners.reduce((d, c) => (
        Math.min(d, distance(c, p))
      ), size);
      let t = 0;
      if (
        d < cube ||
        (z === 0 && x === 0) ||
        (z === size - 1 && x === 0) ||
        (z === size - 1 && x === size - 1) ||
        (z === 0 && x === size - 1) ||
        (
          (y === 0 || y === size - 1) &&
          (
            x === 0 || x === size - 1 ||
            z === 0 || z === size - 1
          )
        )
      ) {
        t = 1;
      }
      update(
        origin.x + x, 1 + y, origin.z + z,  // position
        t                               // block type
      );
    }
  }
}
